<style>
    .container-hierarchy {
    width: 100vw; /* Make the container span the full viewport width */
    /* overflow: auto */
}

.hierarchy {
    width: 40%;
    height: auto;

}


#triangle.in-view {
        fill: none;
        stroke: black;
        stroke-width: 10;
        stroke-dasharray: 6000;
        stroke-dashoffset: 6000;
        animation: draw 2s linear forwards;
      }

#bottom.in-view
{  
    opacity:0;
    animation: fade-in 2s forwards;
animation-delay:  2s;
}

#top {
    
    animation-delay: 2s;
    transform: translateY(50px); 
    opacity:0;
    animation: move-up 2s ease forwards, fade-in 2s forwards;
    animation-delay:  2s, 2s;
}

@keyframes draw {
        to {
          stroke-dashoffset: 0;
        }
      }

@keyframes move-up {
      from {
        transform: translateY(50px); /* Start 50 pixels down */
      }
      to {
        transform: translateY(0); /* End at the original position */
      }
    }
 @keyframes fade-in {
      to {
        opacity: 1;
      }}

@keyframes move-up-appear {
  from {
    transform: translateY(100px); /* Move up 100px initially */
    opacity: 0; /* Invisible initially */
  }
  to {
    transform: translateY(0); /* Move back to original position */
    opacity: 1; /* Fully visible */
  }
}

@keyframes move-up {
    to {
      stroke-dashoffset: 0;
      transform: translateY(0);
      opacity: 1;
    }
  }

.logo {
    opacity: 0;
    transform: translateY(50px); /* Start 50 pixels down */
    animation: 2s ease forwards;
}

.sword {
    opacity: 0;
    
  }
</style>